name: Convert OpenVPN client key to DES3 for Android or iOS clients

Answer: command: openssl x509 -in /etc/openvpn/certs/INDIGOVR-{{ INDIGOVR_NODE_TYPE }}-{{ ansible_fqdn
  }}.crt -out /etc/openvpn/certs/INDIGOVR-{{ INDIGOVR_NODE_TYPE }}-{{ ansible_fqdn
  }}.des3 -CA /etc/openvpn/certs/INDIGOVR-{{ INDIGOVR_NODE_TYPE }}-{{ ansible_fqdn
  }}.crt -CAkey /etc/openvpn/certs/INDIGOVR-{{ INDIGOVR_NODE_TYPE }}-{{ ansible_fqdn
  }}.key -passin file:/etc/openvpn/keys/INDIGOVR-{{ INDIGOVR_NODE_TYPE }}-{{ ansible_fqdn
  }}.passphrase -extfile /etc/openvpn/certs/INDIGOVR-{{ INDIGOVR_NODE_TYPE }}-{{ ansible_fqdn
  }}.extfile
args:
  creates: /etc/openvpn/certs/INDIGOVR-{{ INDIGOVR_NODE_TYPE }}-{{ ansible_fqdn }}.des3
with_items:
- pc2
- pc3

